import React from "react";

const ExpenseForm = () => {
  return (
    <form>
      <div className="new-expense__controls">
        <div>
          <label>title</label>
          <input type="text" />
        </div>
        <div>
          <label>amount</label>
          <input type="text" />
        </div>
        <div>
          <label>date</label>
          <input type="text" />
        </div>
      </div>
    </form>
  );
};

export default ExpenseForm;
